PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "authapp_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authapp_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "token_blacklist_blacklistedtoken" ("blacklisted_at" datetime NOT NULL, "token_id" bigint NOT NULL UNIQUE REFERENCES "token_blacklist_outstandingtoken" ("id") DEFERRABLE INITIALLY DEFERRED, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "token_blacklist_outstandingtoken" ("token" text NOT NULL, "created_at" datetime NULL, "expires_at" datetime NOT NULL, "user_id" bigint NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "jti" varchar(255) NOT NULL UNIQUE, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "zenapp_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "description" text NULL);
CREATE TABLE IF NOT EXISTS "zenapp_eventlog" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(255) NOT NULL, "event_name" varchar(255) NOT NULL, "meeting_id" varchar(50) NOT NULL, "created_date" datetime NOT NULL, "username" varchar(255) NOT NULL, "user_email" varchar(254) NOT NULL, "start_time" datetime NOT NULL, "end_time" datetime NOT NULL, "duration" integer NOT NULL, "participants" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "zenapp_customersupport" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "issue" text NOT NULL, "created_at" datetime NOT NULL, "resolved" bool NOT NULL, "user_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "zenapp_zoommeetingattendance" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "program_name" varchar(255) NOT NULL, "meeting_id" varchar(50) NOT NULL, "created_date" datetime NOT NULL, "username" varchar(255) NOT NULL, "user_email" varchar(254) NOT NULL, "start_time" datetime NOT NULL, "end_time" datetime NOT NULL, "duration" integer NOT NULL, "participants" integer NOT NULL, "event_id" bigint NOT NULL REFERENCES "zenapp_event" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authapp_intrestedtopic" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "topic" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "authapp_university" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "location" varchar(100) NULL, "website" varchar(200) NULL, "logo" varchar(100) NULL, "established" date NULL, "description" text NULL, "contact_email" varchar(254) NULL);
CREATE TABLE IF NOT EXISTS "zenapp_coupon" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(20) NOT NULL UNIQUE, "valid_from" datetime NOT NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL, "discount_type" varchar(10) NOT NULL, "discount_value" decimal NOT NULL, "max_discount" decimal NULL, "min_order_value" decimal NULL, "updated_at" datetime NOT NULL, "usage_limit" integer unsigned NULL CHECK ("usage_limit" >= 0), "used_count" integer unsigned NOT NULL CHECK ("used_count" >= 0), "valid_to" datetime NULL);
CREATE TABLE IF NOT EXISTS "authapp_paymentgateway" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "description" text NULL, "is_active" bool NOT NULL, "credentials" text NOT NULL CHECK ((JSON_VALID("credentials") OR "credentials" IS NULL)), "name" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "zenapp_payment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" decimal NULL, "payment_date" datetime NOT NULL, "status" varchar(20) NOT NULL, "user_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "registration_id" bigint NOT NULL REFERENCES "zenapp_eventregistration" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_gateway_id" bigint NOT NULL REFERENCES "authapp_paymentgateway" ("id") DEFERRABLE INITIALLY DEFERRED, "currency" varchar(5) NOT NULL);
CREATE TABLE IF NOT EXISTS "zenapp_event" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "description" text NULL, "start_date" datetime NOT NULL, "end_date" datetime NOT NULL, "price" decimal NOT NULL, "session_link" varchar(500) NULL, "thumbnail" varchar(100) NULL, "is_featured" bool NOT NULL, "moderator_id" bigint NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "lounge_type_id" bigint NOT NULL REFERENCES "zenapp_category" ("id") DEFERRABLE INITIALLY DEFERRED, "seat_count" integer NULL, "end_time" time NOT NULL, "start_time" time NOT NULL, "is_active" bool NOT NULL, "created_on" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "authapp_country" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "code" varchar(3) NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "authapp_customuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(30) NULL, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "phone_number" varchar(15) NULL, "address" text NULL, "date_of_birth" date NULL, "profile_picture" varchar(100) NULL, "year_of_entry" integer NULL, "university_id" bigint NULL REFERENCES "authapp_university" ("id") DEFERRABLE INITIALLY DEFERRED, "department" varchar(100) NULL, "is_open_to_be_mentor" bool NOT NULL, "work" varchar(100) NULL, "country_id" bigint NULL REFERENCES "authapp_country" ("id") DEFERRABLE INITIALLY DEFERRED, "intrested_topics" varchar(200) NULL, "year_of_graduation" integer NULL);
CREATE TABLE IF NOT EXISTS "zenapp_eventregistration" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "registration_date" datetime NOT NULL, "event_id" bigint NOT NULL REFERENCES "zenapp_event" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "authapp_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "registration_status" varchar(20) NOT NULL, "registration_id" varchar(100) NULL);
